import './App.css';
import { useEffect, useState } from 'react';

function App() {
  const [response, setResponse] = useState({});

  const getApi = () => {
    fetch('https://prototype.sbulltech.com/api/v2/instruments')
      .then(function(response) {
        return response.text();
      }).then(function(data) {
        const arr = data.split('\n');
        let object = {};
        arr.forEach((element, index) => {
          const companyInfo = element.split(',');
          if(companyInfo[0] && index !== 0){
            object = {
              ...object,
              [companyInfo[0]]: {
                symbol: companyInfo[0],
                name: companyInfo[1],
                sector: companyInfo[2],
                validTill: companyInfo[3],
              }
            }; 
          } 
        });

        setResponse(object);
      });
  };

  useEffect(() => {
    getApi();
  }, []);

  console.log('response :: ', response);

  return (
    <div className="container">
      <header className="App-header">
      <table>
        <tr>
          <th>SYMBOL</th>
          <th>NAME</th>
          <th>SECTOR</th>
          <th>VALID TILL</th>
        </tr>
        {(Object.keys(response) || []).map((val, key) => {


          return (
            <tr key={key}>
              <td>{arr[0]}</td>
              <td>{arr[1]}</td>
              <td>{arr[2]}</td>
            </tr>
          )
        })}
      </table>
      </header>
    </div>
  );
}

export default App;
